import 'react-app-polyfill/ie11';
import * as React from 'react';
import * as ReactDOM from 'react-dom';
import { MinChatProvider, useMinChat, useChats, useMessages, useUser } from '../.';


const apiKey = 296197857

/**
 * 
 * @returns 
 */
const App = () => {

  return (
    <MinChatProvider

      test={true}
      apiKey={apiKey}
      user={{
        id: "user2",
        name: "Markus",
        avatar: "https://google.com"
      }} >
      <ChildComponent />
      {/*  */}
    </MinChatProvider>
  );
};


/**
 * 
 * @returns 
 */
const ChildComponent = () => {
  // const { chats } = useChats()

  const minchat = useMinChat()

  const { chats, paginate: paginateChats } = useChats()

  const [messageText, setMessageText] = React.useState("Hello World")

  const [selectedChat, setSelectedChat] = React.useState<any>()

  const chat = minchat.chat({ id: "user2", name: "Jack User 2" })

  //start a groupchat
  // const groupChat = minchat.groupChat({
  //   name: "Dynamo",
  //   members: [{ id: "adam", name: "Adam Steven" }, { id: "user1", name: "Markus" }]
  // })

  // console.log({ chats })

  // console.log("chat test: ",chat?.jsChat.mainConfig.test)

  // console.log({ groupChat })
  const { sendMessage, messages, loading, paginate: paginateMessages } = useMessages(chat)

  // console.log({ chats })

  const user = useUser()

  console.log({ chats })

  // console.log({ loading, messages })

  React.useEffect(() => {
    if (chats && chats.length > 0) {
      setSelectedChat(chats[1])
    }
  }, [chats])

  const handleSendMessage = () => {
    sendMessage({ text: messageText }, (err, success) => { console.log("send message response", { success, err }) })
  }


  const handlePaginate = () => {
    paginateChats()
    paginateMessages()

  }

  return (
    <div>
      <input
        onChange={e => setMessageText(e.target.value)}
      />
      <button onClick={handleSendMessage}>Send</button>
      <button onClick={() => setSelectedChat(minchat.chat({ id: "adam", name: "Adam Steven" }))}>Switch chat</button>
      <button onClick={handlePaginate}>Paginate</button>

    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'));
